import Header from "../Components/Header/Header";
import "../Styles/Media-Queries.css";
import "../Styles/Media-Queries.css";
import Links from "../Components/Footer/Links";
import Menu from "../Components/Main/Menu";
const Home=()=>{
    return(
        <div>
            <Header/>
            <Menu></Menu>
            <footer className="footer-main">
                <Links></Links>
            </footer>
        </div>
    )

};

export default Home;
